'use strict';

var Caml = require("@rescript/std/lib/js/caml.js");
var Belt_Id = require("@rescript/std/lib/js/belt_Id.js");
var Belt_MutableMap = require("@rescript/std/lib/js/belt_MutableMap.js");

var cmp = Caml.float_compare;

var Id = Belt_Id.MakeComparable({
      cmp: cmp
    });

function empty(param) {
  return Belt_MutableMap.make(Id);
}

function get(el, t) {
  return Belt_MutableMap.get(t, el);
}

var toArray = Belt_MutableMap.toArray;

exports.Id = Id;
exports.empty = empty;
exports.get = get;
exports.toArray = toArray;
/* Id Not a pure module */
